import './main-page.css';
import profile_image from '../../images/profile_image.png';

function MainPage() {
  return (
    <div className="main-test">
      <img src={profile_image}/>
      <ProfileInfo/>
    </div>
  );
}

function ProfileInfo() {
  return (
    <div>
      <div>성여명</div>
      <div>1042007897</div>
    </div>
  )
}

export default MainPage;
